import React from "react";
import "./navigation-dropdown.scss";

const NavigationDropdown = ({ categories }) => {
  return <div className="navigation-bar__link__dropdown">
    { categories.map((item => (
      <h2>item.title</h2>
    )))}
  </div>;
};

export default NavigationDropdown;
